2023-06-08 06:44:18.727734	t	Drone24Hours_Flywoo_Explorer_LR_4′′_V2_HD	Flywoo Explorer LR 4′′ V2 HD	Il Flywoo Explorer LR HD Quad è un nuovissimo tipo di quad noto come “#MicroLongRange”, creato da Dave_C FPV in collaborazione con Flywoo. Questo capolavoro spingerà al massimo le tue abilità di sparatutto in prima persona! #MicroLongRange è un campo nuovo di zecca, che consente ai piloti fpv di ottenere incredibili filmati HD, il tutto catturando filmati incredibili ad alta velocità. L’Explorer LR HD viene fornito con un’antenna ATOMIC 5.8G personalizzata per Explorer LR, Caddx Polar Vista Digital HD System , GOKU 16×16 Micro Stack, motori NIN 1404 V2 2750KV e altro, rendendo questo quad da 4′′ un vincitore! La versione Explorer LR HD 4′′ V2 ha ottimizzato e aggiornato molte funzionalità! Principale Changelog V2: GPS aggiornato a V2.0 – Più veloce e più stabile Dotato di pila Goku F745 16×16 Cavo di alimentazione della fotocamera SMO 4K integrato Sistema Caddx Polar Vista HD digitale Aggiornamento super antiscivolo Modulo BT-Nano integrato Nota: fotocamera SMO 4K e supporto per fotocamera NON inclusi. VIDEO: Flywoo Explorer LR HD 4” V2 Micro FPV ultraleggero a lungo raggio   Messaggio da Dave_C FPV : Per me personalmente, la crociera a lungo raggio attraverso paesaggi epici è la cosa migliore di FPV! Ma sfortunatamente, è sempre stato un po’ difficile esercitarsi legalmente e senza infastidire le persone con tutto il rumore prodotto da un enorme quad a lungo raggio da 6 o 7 pollici. Così è nata l’idea di base alla base del progetto originale #MicroLongRange: ridimensionare un quad da 7 pollici a lungo raggio fino a quando non scende al di sotto di 250 g di peso al decollo. Con il supporto di una fantastica community su Facebook e Instagram, nonché un enorme sforzo di sviluppo di Flywoo, questo concetto ha visto molti miglioramenti che ora sono tutti implementati nell’Explorer LR! Questo minuscolo quad è dotato di GPS, Crossfire e un cercatore di modelli indipendente per darti la sicurezza necessaria per spingerlo alla massima gamma di trasmissione video digitale e analogica. Il propulsore con il suo stack GOKU 16×16 e i nuovissimi motori 2700kV 1404 che girano eliche da 4′′ è ottimizzato per la massima efficienza e peso ridotto: tempi di volo di oltre dieci minuti con una normale batteria LiPo da 850 mAh 4S sono facilmente ottenibili! Velocità di crociera di 40 -50 km/h (25-30 mph) sono sorprendentemente alti per un quad così piccolo e mi hanno permesso di fare facilmente 10 km (6 miglia) di andata e ritorno. E la cosa migliore: è incredibilmente silenzioso! Lo sentirai a malapena volando non appena sei a poche decine di metri di distanza. ” —– Dave_C FPV Caratteristiche La versione V2 presenta un potente controller di volo F745 ricco di funzionalità tra cui un barometro, una scatola nera, 7 porte seriali hardware complete, funzionalità I2C e LED WS2812 su ogni angolo. Questo leggero quad da 4 pollici è inferiore a 250 g anche se ti colleghi alla batteria, che soddisfa l’attuale richiesta delle regole FAA. Aggiorna il GPS a V2.0, che utilizza una lamina di rame per prevenire efficacemente l’interferenza del segnale da parte di Vista. Facile da controllare e con tempi di volo lunghi, lo consigliamo vivamente ai principianti FPV e ai piloti che amano la crociera! Modulo Bluetooth integrato, puoi utilizzare i dispositivi mobili per impostare i parametri del volo. FLYWOO GOKU GPS MINI V2.0 FUNZIONE DI SALVATAGGIO Prima del disinserimento, il GPS deve cercare più di 5 satelliti per bloccare la posizione iniziale. Dopo il disinserimento, osservare i dati OSD durante il volo e la funzione di soccorso può funzionare normalmente solo se la distanza supera i 100 m. Altrimenti, il quad andrà in crash. Se il telecomando perde improvvisamente il segnale, la funzione di salvataggio GPS funzionerà automaticamente e tornerà alla posizione iniziale. (Imposta l’AUX della modalità di salvataggio GPS in betaflight Failsafe, l’impostazione predefinita è AUX3 2000) RICERCA FLYWOO V1.0 Flywoo Finder v1.0 può alimentarsi per emettere un segnale acustico e la luce LED per lampeggiare anche se la batteria del quad è stata espulsa. Fingder v1.0 può funzionare per 4-5 ore. Premere il pulsante per 3 secondi per chiuderlo Cavo di alimentazione della fotocamera SMO 4k integrato. AGGIORNAMENTO ANTISCIVOLO Pad batteria adesiva di alta qualità incluso per le batterie LiPo. Questo resistente pad della batteria è realizzato in materiale PU può aderire a una batteria a 90° su un lato e persino ruotare di 180° senza cadere! FC & ESC Il GOKU F745 16X16 STACK utilizza un potente chip F745 BGA, barometro, scatola nera, WS2812LED, supporta 7 porte seriali hardware complete, I2C e altre funzioni sono tutte aperte! Soddisfa tutte le esigenze di FPV.   Specifiche Fotocamera digitale HD e VTX: sistema Vista Caddx Polar Digital HD Opzione ricevitore: PNP / Frsky XM+ / Frsky R9M / TBS Crossfire FC & ESC: GOKU F745 Quad 16*16 STACK – (FC + 13A ESC) Antenna: Atomic 5.8GHz Antenna Lunghezza 130mm (UFL LHCP) Motori: MOTORE FPV ULTRALEGGERO NIN 1404 V2 2750KV Telaio: EXPLORER LR 4” KIT TELAIO V2 VERSIONE HD Peso: 162,8 g (senza batteria) Oggetti di scena: Gemfan 4024 a 2 lame Interasse: 168 mm BATTERIE Consigliate (non incluso) 1050 4S XT30 (Tattu personalizzato per Explorer LR) 18650 3000 mah (Esploratore) 4S 1300 120C XT30 4S 650 95C XT30 4S 750 95C XT30 4S 850 95C XT30 Il pacchetto Include 1x Flywoo Explorer LR HD 4′′ V2 BNF con sistema Caddx Polar Vista Digital HD (ricevitore opzionale) 2x eliche Gemfan 4024 (set di 4) 2x supporto per braccio laterale in carbonio 1x copriobiettivo per fotocamera 1x TPU stampato in 3D 1x set di hardware 1x pad batteria 1x cinturino LiPo 1 chiave a brugola Nota: fotocamera SMO 4K e supporto per fotocamera NON inclusi.	399.99	EUR	https://www.drone24hours.com/wp-content/uploads/2022/10/Flywoo-Explorer-LR-FPV-HD-422-V2-1.jpeg	https://www.drone24hours.com/prodotto/flywoo-explorer-lr-4-v2-hd/?D24H=lucapalonca	7	\N	2023-06-08 06:44:18.727709	\N	22	ea3f98a2-0ede-44b2-a24c-1c75a4c31d4a	60
