2023-06-08 06:39:03.726923	t	Drone24Hours_TBS_UNIFY_PRO_5G8_HV_–_RACE_(SMA)	TBS UNIFY PRO 5G8 HV – RACE (SMA)	Caratteristiche principali Trasmettitore video più piccolo e leggero sul mercato Alimentazione in ingresso 2-6S supportata Impostazioni di potenza 25mW / 200mW Trasmissione ultra pulita (fino a 16 piloti contemporaneamente!) PitMode: accendi il quad durante una gara Facile cambio dei canali OSD, FC e RC, con menu del pulsante di fallback Il robusto amplificatore RF consente l’accensione senza antenna per ore! Clean powerup e commutazione video Certificato CE Pitmode-fatto per correre Zero interferenze anche durante l’accensione, ora è una possibilità! Se hai mai riparato un quad durante una gara, conoscerai le frustrazioni di non poter accendere e testare il tuo sistema. Con PitMode, ridurremo la potenza di uscita al minimo indispensabile (molto al di sotto dei mW a una cifra) e ci sposteremo alle frequenze non utilizzate dagli organizzatori di gare, per consentirti di alimentare il tuo quad e vedere ancora l’immagine! Hai alcuni metri di autonomia per mettere a dura prova il tuo quad prima di posizionarlo su quella griglia di partenza e in combinazione con CleanSwitch puoi accenderlo non appena il tuo canale è disponibile senza interrompere nessuno dei canali attivi. Smartaudio V2 -controllo completo La tecnologia SmartAudio fornisce il controllo UART e I2C per l’intero trasmettitore video. Parametri come potenza di uscita, bande, canali e frequenza possono essere controllati liberamente. Ciò consente il controllo dei canali remoti direttamente da un dispositivo intelligente (TBS Crossfire, modulo bluetooth esterno o wifi richiesto), dalla radio (TBS Crossfire con TBS Tango o telecomando compatibile OpenTX richiesto) o dall’OSD (ad es. TBS CORE PRO). Con tutte queste opzioni disponibili, dovresti trovare qualcosa che si adatta al tuo conto. Insieme a CleanSwitch, il cielo è il limite ... saltare tra i canali senza interferire con gli altri piloti in aria, creare frequenze di backup / emergenza, regolazioni globali della potenza VTx da parte degli organizzatori di gare o altri sistemi intelligenti volti a semplificare e migliorare la gestione della gara sono ora una possibilità! Cleanswitch – Neighbor friendly CleanSwitch è una tecnologia sviluppata da TBS che garantirà che il trasmettitore video sia privo di interferenze durante l’accensione o durante la modifica dei canali. Tutti gli attuali trasmettitori video passano sull’intera banda mentre sono accesi, causando spesso sfarfallio e forti interferenze con chiunque nell’aria, indipendentemente dal canale video scelto. TBS CleanSwitch ti permetterà di accendere e cambiare canale mentre i tuoi amici sono in aria, senza alcuna interferenza esterna. CleanSwitch è adatto alle gare e ai piloti ... ecco come ci piace a TBS 🙂 Dì no! A Dipswitches Anche se l’apprendimento binario è stato un divertente gioco mentale, in pratica un trasmettitore video a pulsante singolo o controllato da OSD è molto più semplice da utilizzare. Sono finiti i tempi delle schede del trasmettitore video, che calpestavano i canali delle persone per errore o una discrepanza tra la frequenza della maschera e quella del trasmettitore video. Specificazioni Tensione di funzionamento: 2S – 6S Corrente di alimentazione: 600 mA Temperatura di funzionamento: controllare il normale flusso d’aria Frequenza portante audio: 6,5 MHz Impedenza di ingresso video: 75 Ohm Peso: 7 g (con SMA, senza antenna) Connettore di ingresso: JST GH 7pin (dopo luglio 2018) Connettore antenna: presa femmina SMA con fori per il montaggio a vite, da U.FL a VTx Formato video: NTSC / PAL Potenza di uscita: 13dBm (25mW), 23dBm (200mW) Il pacchetto include Trasmettitore video TBS UNIFY 5G8 Cavo codino trasmettitore video DOWNLOAD Manuale TBS UNIFY Pro Manuale TBS UNIFY Pro (tedesco) Specifiche di TBS SmartAudio * Per il funzionamento su canali HAM e livelli di potenza HAM è necessaria la licenza HAM! Il VTx viene fornito con solo canali legali abilitati, consultare il manuale sulla procedura di sblocco.	24.99	EUR	https://www.drone24hours.com/wp-content/uploads/2019/10/DSC01110111race-ga.jpg	https://www.drone24hours.com/prodotto/tbs-unify-pro-5g8-hv-race-sma/?D24H=lucapalonca	7	t	2023-06-08 06:39:03.726895	\N	10	c8901bc0-2ea6-48f9-a0ef-13b0de83bc98	60
