nza in uscita tramite Smart Audio, rendendo così possibili le gare di squadra o l’accensione dei quad in standby. Cleanswitch-amico del vicino CleanSwitch è una tecnologia sviluppata da TBS che assicurerà che il tuo trasmettitore video sia privo di interferenze durante l’accensione o durante il cambio di canale. Tutti i trasmettitori video attuali scorrono sull’intera banda mentre sono accesi, spesso causando sfarfallio e forti interferenze a chiunque sia nell’aria, indipendentemente dal canale video scelto. TBS CleanSwitch ti consentirà di accendere e cambiare canale mentre i tuoi amici sono in aria, senza alcuna interferenza esterna. CleanSwitch è adatto alle gare e ai piloti... è così che ci piace su TBS 🙂 Specifiche Tensione di esercizio: 2S – 6S Corrente di alimentazione: 600 mA Temperatura di esercizio: osservare il normale flusso d’aria Frequenza portante audio: 6.5 MHz Impedenza di ingresso video: 75 Ohm Peso: 4,2 g Connettore antenna: MMCX Formato video: NTSC/PAL Potenza in uscita: 13dBm (25mW), 20dBm (100mW), 26dBm (400mW) Dimensioni: 27 x 20 x 4 (mm) Il pacchetto include Trasmettitore video TBS UNIFY 5G8 (MMCX) Fili in silicone per cablaggio DOWNLOAD Manuale di TBS UNIFY Pro Manuale TBS UNIFY Pro (tedesco) Specifiche TBS SmartAudio 2.1 Tabella VTX per Betaflight * La licenza HAM è necessaria per il funzionamento sui canali HAM e sui livelli di potenza HAM! Il VTx viene spedito con solo i canali legali abilitati, consultare il manuale sulla procedura di sblocco.	39.98	EUR	https://www.drone24hours.com/wp-content/uploads/2021/09/TBS-UNIFY-PRO-5G8-HV-RACE-2-MMCX-1.jpeg	https://www.drone24hours.com/prodotto/tbs-unify-pro-5g8-hv-race-2-mmcx/?D24H=lucapalonca	7	t	2023-06-08 06:39:05.350921	\N	10	5881c517-54ba-4457-b85f-db9db1742aa0	60
