ssfire. Tutti i migliori piloti di droni volano con il TBS Crossfire. Le missioni a lungo raggio più lontane vengono effettuate con TBS Crossfire. Ora è diventato accessibile alle masse come collegamento radio generico! Telemetri/ CRSF Essendo un moderno collegamento R / C, ha la telemetria incorporata. La comunicazione bidirezionale apre nuove possibilità. Dallo streaming di MAVLink al tuo dispositivo smart (nessun supporto di streaming Mavlink per Crossfire Micro TX!), All’aggiornamento del firmware, all’impostazione del canale del trasmettitore video o alla regolazione dei parametri di controllo del volo come i PID. La larghezza di banda adattiva controlla la velocità di trasmissione o ottimizza per la massima portata. CRSF è un protocollo di comunicazione TBS proprietario tra Crossfire e R / C e Flight Control. Fornisce una latenza estremamente bassa con un’incredibile larghezza di banda (3 volte più veloce, 6 volte più dati rispetto a qualsiasi protocollo comparabile!). Con un’integrazione così stretta, il TBS Crossfire è la scelta logica per chiunque utilizzi piattaforme Betaflight, KiSS o ArduPilot / Pixhawk. DOWNLOAD Manuale TBS Crossfire Manuale TBS Crossfire (tedesco) Guida rapida di TBS Crossfire Micro TX TBS Agent X (per aggiornamenti software) Ultimi script LUA OpenTX per Crossfire TBS Cloud – Firmware Wi-Fi TBS Cloud – Crossfire e Mavlink Over Wifi Firmware OpenTX Nightly (aggiornato – 25 agosto 2020) Caratteristiche del prodotto Sistema di controllo remoto a lungo raggio, adattivo e robusto per il tuo aereo Immune al rumore di bordo Collegamento di comunicazione bidirezionale con dati vitali di collegamento in tempo reale e telemetria Autoguarigione e salto di frequenza (DSSS, FHSS) Controllo adattivo della larghezza di banda e ottimizzazione della portata Rilegatura e configurazione super facili tramite il display integrato del tuo R / C Bassa latenza, frequenza di aggiornamento di 150 Hz (3 volte più veloce dei tipici collegamenti RC) per 