2023-06-08 06:38:52.160479	t	Drone24Hours_TBS_CROSSFIRE_TX_–_TRASMETTITORE_A_LUNGO_RAGGIO	TBS CROSSFIRE TX – TRASMETTITORE A LUNGO RAGGIO	Una nuova era di connettività TBS CROSSFIRE TX è un collegamento R / C a lungo raggio basato sulla più recente tecnologia RF, in grado di autoriparare comunicazioni bidirezionali e andare oltre la comprensione. Con una sensibilità di -130dB, diveristy lato RF completo, piccoli ricevitori per quad FPV, TBS CROSSFIRE contiene la tecnologia più moderna per fornire un collegamento di controllo a lungo raggio superiore. I collegamenti di controllo remoto, tuttavia, hanno un compito molto più che esteso. Latenza, telemetria, robustezza contro le interferenze, connettività con dispositivi intelligenti, facilità d’uso e finitura generale sono troppo spesso sacrificati per quell’ultimo bit di portata. Il Crossfire ha un’ampia gamma e utilizza quel margine per funzionalità e affidabilità aggiuntive. Un futuro luminoso per FPV è alle porte 🙂 Sviluppato da esperti Il team BlackSheep è stato famoso per i record a lungo raggio, la vicinanza al suolo che vola nelle Alpi e le operazioni nelle profondità urbane. Durante le nostre numerose missioni in tutto il mondo abbiamo raccolto un elenco di requisiti e abbiamo scoperto che nessun sistema esistente può soddisfarli tutti. Quindi abbiamo intrapreso un lungo e doloroso percorso per sviluppare un sistema di collegamento RC interamente da zero, mettendolo alla prova per oltre un anno per garantire l’affidabilità e la funzionalità all’avanguardia. Tramite il display OLED sul trasmettitore, puoi monitorare la posizione in tempo reale del tuo drone (sono richiesti GPS TBS o BlackBox con DJI Naza o GPS basato su APM). Lo stato di uplink e downlink offre una sensazione di sicurezza, le opzioni di configurazione tramite il display OLED eliminano qualsiasi strumento di configurazione basato su PC. Il LED a impulsi trasmette il budget del collegamento e lo stato del collegamento in forma colorata (verde = continua, arancione = ruota intorno). In caso di crash, la posizione del drone è visibile anche sull’OLED. La batteria integrata sul ricevitore lo trasforma automaticamente in un faro e continuerà a trasmettere la sua ultima posizione nota fino a quando la batteria si esaurisce. Funziona e basta Oltre alla gamma senza pari, la cosa di cui siamo più orgogliosi su TBS CROSSFIRE è che funziona. In passato, la nostra domanda era sempre “il nostro collegamento R / C poteva tenere il passo?”. Con TBS CROSSFIRE ti viene in mente. Ma non crederci sulla parola. Tutti i principali organizzatori di corse di droni richiedono ai piloti di pilotare il TBS Crossfire. Tutti i migliori piloti di droni pilotano il TBS Crossfire. Le missioni a lungo raggio più lontane vengono pilotate con TBS Crossfire. Questo è il collegamento a lungo raggio che tutti stavano aspettando! Telemetria/Crsf Come un moderno collegamento R / C, ha la telemetria integrata. La comunicazione bidirezionale apre nuove possibilità. Dallo streaming di MAVLink al tuo dispositivo intelligente, all’aggiornamento del firmware, all’impostazione del canale del trasmettitore video o alla regolazione dei parametri di controllo del volo come i PID. La larghezza di banda adattiva controlla la velocità di trasmissione o ottimizza per la massima portata. CRSF è un protocollo di comunicazione proprietario TBS tra Crossfire e R / C e Flight Control. Fornisce una latenza bassissima con un’ampiezza di banda incredibile (3 volte più veloce, 6 volte più dati rispetto a qualsiasi protocollo comparabile!). Con una stretta integrazione, TBS Crossfire è la scelta logica per chiunque voli su piattaforme Betaflight, KiSS o ArduPilot / Pixhawk. DOWNLOAD Manuale TBS Crossfire TX Manuale TBS Crossfire (tedesco) TBS Agent X (per aggiornamenti software) Gli ultimi script LUT OpenTX per Crossfire Caratteristiche Sistema di controllo remoto a lungo raggio, adattivo e robusto per il tuo aereo Immune al rumore di bordo