fect match of lightweight 2004 3000KV motor and HQ 5025 3-Blade Props, pilots can get an excellent racing flight experience.  Specifications: Item: X-Knight 360 FPV Quadcopter (HD Digital VTX)  Weight: 211.9g (without battery) FC&ESC: F4 35A AIO Brushless FC AIO Motors: 2004 3000KV 4S Brushless Motors Props: HQ 5025 3-Blade Props HD digital camera & VTX: Caddx Nebula Nano HD Digital System FPV Camera Degree: 25°-45° Battery: 4S 1000mAh Battery(Not Including) Connector: XT60 Frame: X-Knight 360 Carbon Frame Kit Receiver Option: Frsky XM+ / TBS Crossfire Flight time: 7min smooth flight or 5min flight of FPV freestyle tricks with 4S 1000mAh battery Package Includes: 1 * X-Knight 360 FPV Quadcopter (HD Digital VTX) 1 * Spare HQ 5025 3-Blade Props (2CW+2CCW) 1 * Screw Pack Insta360 ONE R Camera: Insta360 ONE R brings innovative modular design, AI editing and the best quality footage yet, which makes the Insta360 a must-buy for action camera and 360 fans. It offers the resolution of a high-end action camera and the versatility and ability to reframe clips after shooting that you can only get from a 360-degree camera. It is a highly capable and versatile camera that’d be a great companion for vloggers and digital content creators.  What's more, Insta360 ONE R provides brand-new unobstructed and impossible angles, perfectly fit the needs of 360 FPV filming shooting. Caddx Nebula Digital VTX: The Caddx Nebula Nano HD System can perfectly support with DJI goggles. With DJI goggles, it can provide 720p/60fps digital high-definition picture and a transmission range up to 4km. Users can choose 25mW/200mW/500mW/700mW from DJI goggle settings. The total weight (excluding antenna) is 24g only, about 26g lighter than the DJI FPV unit. Besides, it is smaller and designed for whoop drones.  Flight Controller: F4 35A AIO Brushless FC- The board is the first BLHeli_32 ESC 35A All-in-one FC on the current market. It can handle 35A continuous current(40A burst) and provide with massive levels of performance capability, but it still maintains ultralight only 7g. In addition, this board supports a 2-6S Lipo battery, perfectly suitable for the 4''-5'' drone.  Motors & Props: 2004 3000KV Brushless Motors is a lightweight 4S motor. It only weights 16.4g / 1pc. Best matched with the HQ 5025 3-Blade Props, the motor is very efficient in use and has an excellent racing flight experience. Combined with F4 35A AIO Brushless FC, it will provide you enough output power. Recommended Battery: 4S 1000mAh Battery with XT60 connector is the best option to power the X-Knight 360 FPV Quadcopter. This battery is specially customized for X-Knight 360 FPV Quadcopter. With the flat design, the battery is only 23mm height, perfectly hides the battery from the camera's sight. With a 4S(14.8V) high voltage and 75C discharge rate, it gives the drone a stronger flight performance for short bursts.  X-Knight 360 Carbon Frame Kit: X-Knight 360 Carbon Frame Kit is an innovative, versatile and functional design frame, which adopts carbon material becomes ultimate durability while maintaining minimal weight. With this special-designed frame, pilots can capture an aerial 360 video without any limitation - hide the drone entirely from sight.  FAQ: Cli Dump of X-Knight 360 FPV Quadcopter (HD Digital VTX)  ( Click here to find the details.) How to assemble the Insta360 ONE R on the X-Knight 360 FPV Quadcopter. Batteries and Insta360 ONE R Camera are not included in the package.	249.97	USD	https://cdn.shopify.com/s/files/1/2778/6650/products/1_df6812ac-8094-4e4f-a529-608678fb876d_740x.png?v=1603829186	https://pyrodrone.com/products/betafpv-x-knight-360-fpv-quadcopter-hd-digital-vtx	18	t	2023-06-09 07:42:16.91936	\N	6	c49fde00-2f7c-4d0b-a171-e8209ef5e61d	92
