2023-06-08 06:43:51.127201	t	FPV24_DJI_Mini_2_HD_Drone	DJI Mini 2 HD Drone	DJI Mini 2 HD DroneProduct description DJI Mini 2 HD Drone Take-off weight under 250g - DJI Mini 2 may also be operated without any problems under the EU UAV regulation valid from 01.01.2021. No registration and no proof of knowledge or "driving licence" is required, only a liability insurance is needed! Let your imagination runwildDJI Mini 2 is beginner-friendly, powerful and ... mini. Impressive performance, stunning picture quality and creative video are always at your fingertips. Discover a whole new perspective and capture the moments that define your life.  Ultralight with 249 g weight 31 min. Max. Flight time Top-of-the-line 3-Axis Gimbal with 4K camera 4x digital zoom Up to 10 km HD video transmission with OccuSync 2.0 Flyable up to wind force 5 (up to 34 km/h) Intelligent recording modes & QuickShots Pack light and enjoy the freedomHow light is DJI Mini 2? Weighing less than 249g, it weighs about the same as an apple and fits in the palm of your hand. Compact and practical, the Mini 2 is your ideal travel companion, changing the way you capture your favourite memories. Small But Mighty Thanks to its compact size and intuitive and advanced features, DJI Mini 2 offers total freedom to express your creativity, whether you're shooting on a deserted beach or capturing the details of a happy family reunion, Mini 2 is always there. Extremely powerful It may be small, but this drone is full of power and energy. With a maximum battery life of 31 minutes, DJI Mini 2 offers more than enough time to create the perfect shot, and Mini 2 is still airworthy in wind force 5 and can even fly in force 4.It can take off even at an altitude of 4,000 meters, so your videos are stable even if you're flying along a windy coast or high above a forest in the Alps. OccuSync 2.0 video transmission Discover your world completely unrestricted. Mini 2 supports up to 10km of HD video and has excellent interference-free video transmission, so you can fly further and see more clearly. Picture quality that impresses 3-axis gimbal with 4K camera It's like pressing the play button in your memories. A 12-megapixel camera in the sky delivers photos and videos that are guaranteed to impress. Combined with 4K/30fps video and a motorized 3-axis gimbal, Mini 2 delivers stunning image quality that keeps video smooth and fluid no matter what your adventurous spirit. 4x zoom It's not necessary to be this close for your dream shot. The 4x digital zoom makes the transition between shots of different distance and composition safer and more comfortable. QuickShots Master aerial photography in no time. In just a few simple steps, DJI Mini 2 automatically records professional videos that can be shared directly on social media. Whether you're a beginner or a seasoned aviator, the DJI Fly app lets you get impressive results with soundtracks and filters. The available QuickShots are: Dronie, Helix, Rocket, Circle, Boomerang. Panorama Show how breathtaking your view is Choose from wide-angle, 180°, and spherical panoramas and DJI Mini 2 does the rest, creating an instant panoramic masterpiece. Improved photos Why wait to share your best photos? The DJI Fly app offers intelligent, built-in photo enhancement. The app automatically improves image quality after downloading a photo, resulting in vibrant colours and details. Exercise creativity with amazing results Easy flight control for breathtaking videos/photos In addition to a new simplified operation, the DJI Mini 2 also features improved intelligent functions. The intelligent return function, automatic start and precise hovering make operation easier and safer than ever before. Let your creativity run wild and turn the sky into your new playground. Fly Spots Discover new adventures. Aren't you sure where you should be flying? Finding a suitable starting point for flying should not give you a headache. Plan your flight route in advance with the DJI 