2023-06-08 06:38:53.777518	t	Drone24Hours_TBS_CROSSFIRE_TX_LITE	TBS CROSSFIRE TX LITE	TBS CROSS FIRE TX LITE Una nuova era di connettività TBS CROSSFIRE è un collegamento R / C a lungo raggio basato sulla più recente tecnologia RF, in grado di autoriparare comunicazioni bidirezionali e andare oltre la comprensione. Con una sensibilità di -130dB, diveristy lato RF completo, piccoli ricevitori per quad FPV, TBS CROSSFIRE contiene la tecnologia più moderna per fornire un collegamento di controllo a lungo raggio superiore. I collegamenti di controllo remoto, tuttavia, hanno un compito molto più che esteso. Latenza, telemetria, robustezza contro le interferenze, connettività con dispositivi intelligenti, facilità d’uso e finitura generale sono troppo spesso sacrificati per quell’ultimo tratto. Il Crossfire ha un’ampia gamma e utilizza quel margine per funzionalità e affidabilità aggiuntive. Un futuro luminoso per FPV è alle porte 🙂 Sviluppato da esperti Il team BlackSheep è stato famoso per i record a lungo raggio, la vicinanza al suolo che vola nelle Alpi e le operazioni nelle profondità urbane. Durante le nostre numerose missioni in tutto il mondo abbiamo raccolto un elenco di requisiti e abbiamo scoperto che nessun sistema esistente può soddisfarli tutti. Quindi abbiamo intrapreso un lungo e doloroso percorso per sviluppare un sistema di collegamento RC interamente da zero, metterlo alla prova per oltre un anno per garantire l’affidabilità e la funzionalità all’avanguardia. Tramite il display OLED sul trasmettitore, è possibile monitorare la posizione in tempo reale del drone (è necessario TBS GPS o BlackBox con DJI Naza o GPS basato su APM). Lo stato di uplink e downlink offre una sensazione di sicurezza, le opzioni di configurazione tramite il display OLED eliminano qualsiasi strumento di configurazione basato su PC. Il LED a impulsi trasmette il budget del collegamento e lo stato del collegamento in forma colorata (verde = continua, arancione = ruota intorno). In caso di crash, la posizione del drone è visibile anche sull’OLED. La batteria integrata sul ricevitore lo trasforma automaticamente in un faro – e continuerà a trasmettere la sua ultima posizione nota fino a quando la batteria si esaurisce. Funziona e basta Oltre alla gamma senza pari, la cosa di cui siamo più orgogliosi su TBS CROSSFIRE è che funziona. In passato, la nostra domanda era sempre “il nostro collegamento R / C poteva tenere il passo?”. Con TBS CROSSFIRE ti viene in mente. Ma non crederci sulla parola. Tutti i principali organizzatori di corse di droni richiedono ai piloti di pilotare il TBS Crossfire. Tutti i migliori piloti di droni pilotano il TBS Crossfire. Le missioni a lungo raggio più lontane vengono pilotate con TBS Crossfire. Questo è il collegamento a lungo raggio che tutti stavano aspettando! Telemetria / CRSF Come un moderno collegamento R / C, ha la telemetria integrata. La comunicazione bidirezionale apre nuove possibilità. Dall’aggiornamento del firmware, dall’impostazione del canale del trasmettitore video alla regolazione dei parametri di controllo del volo come i PID. La larghezza di banda adattiva controlla la velocità di trasmissione o ottimizza per la massima portata. CRSF è un protocollo di comunicazione proprietario TBS tra Crossfire e R / C e Flight Control. Fornisce una latenza bassissima con un’ampiezza di banda incredibile (3 volte più veloce, 6 volte più dati rispetto a qualsiasi protocollo comparabile!). Con una stretta integrazione, TBS Crossfire è la scelta logica per chiunque voli su piattaforme Betaflight, KiSS o ArduPilot / Pixhawk. DOWNLOAD Manuale TBS Crossfire Manuale TBS Crossfire (tedesco) TBS Agent X (per aggiornamenti software) Gli ultimi script LUT OpenTX per Crossfire Caratteristiche Sistema di controllo remoto a lungo raggio, adattivo e robusto per il tuo aereo Immune al rumore di bordo Collegamento di comunicazione bidirezionale con collegamenti vitali e telemetria in tempo reale Auto-guarigione e salto di frequenza (DSSS, FHSS) Controllo adattativo della larghezza di banda e ottimizzazione della portata Modem seriale in grado di trasmettere protocolli seriali (up & downlink) Modalità beacon RX per recuperare l’aereo abbattuto Rilegatura e configurazione semplicissime tramite display integrato Bassa latenza, frequenza di aggiornamento di 150Hz (3 volte più veloce dei normali collegamenti RC) per una sensazione di immersione perfetta Due modelli di ricevitori: 8ch Diversity Rx, 4ch PPM / SBUS Mini-ricevitore (peso 4g!) Uscita a 8 o 12 canali tramite PPM / SBUS / CRSF su entrambi i ricevitori Possibilità di volare con più amici contemporaneamente (10 o più) Potenza RF selezionabile da 10mW a 2W (si applicano restrizioni locali) Opzione di input di tracciamento della testa dedicato per immersione full FPV Il LED del trasmettitore mostra lo stato del collegamento, display OLED per la configurazione integrata Uscita telemetrica di connettività mobile a corto raggio per app per smartphone Completamente configurabile da OpenTX e TBS TANGO remoto tramite protocollo CRSF Interfaccia protocollo CRSF per Betaflight, Kiss e Raceflight FC (latenza inferiore, frequenza di aggiornamento più elevata, supporto di telemetria) Porta di espansione per il supporto delle funzionalità future Micro-ricevitore per droni più piccoli. Più piccolo di quanto pensi! Aggiornamenti software tramite RF Link Specifiche tecniche Bande di frequenza: 868 MHz (UE, Russia) / 915 MHz (USA, Asia, Australia) Tensione di ingresso: 3,5 – 13 V. Consumo energetico: 1,1 W (@ 10mW) – 3,2 W (@ 2000mW) Dimensioni: 55 x 89 x 15 mm Peso: 76 g Il pacchetto include Trasmettitore TBS Crossfire tx lite Adattatore JR TBS Crossfire tx lite TBS Crossfire Stock Tx Antenna V2 Cavo Futaba Crossfire Cavo Crossfire Graupner Treccia PWM Crossfire Cavo Crossstire da JST a XT30 CERTIFICATI TBS Crossfire tx lite – Certificato FCC Parte 15C TBS Crossfire tx lite – Certificato FCC Parte 15B TBS Crossf