2023-06-08 06:41:13.889975	t	BetaFPV_Meteor65_Pro_Brushless_Whoop_Quadcopter_(2022)	Meteor65 Pro Brushless Whoop Quadcopter (2022)	METEOR65 PRO IS DESIGNED FOR EXPRESSLRS PILOT IN THIS WINTER! Meteor65 Pro comes with a 35mm propeller for power improvement and a flexible flying experience. Beyond that, it has almost the same components and features as Meteor65, like F4 1S 5A FC (2022) with built-in serial ExpressLRS 2.4G, Frsky, or TBS RX version, up to 350mW M03 VTX, 19500KV 0802SE motors, C03 FPV camera etc, All aspects of performance are perfectly balanced.  Tons of ExpressLRS items are available now! Bullet Point By using the latest 0802SE 19500KV motors and 35mm 3-blade props, this kit provides you with a completely different experience of a powerful indoor flight. Built-in 1.45g ultralight weight and upgraded C03 FPV camera. This new camera has optimal performance for indoor whoop drones. Adopt with injection molding technique, this canopy is 1.60g ultralight weight and is more durable, anti-ruin, and heat-resistant, providing good protection for the whoop drone. Reserve two UART ports on F4 1S 5A FC (SPI Frsky) board. The Frsky version also can be used as the PNP version. Therefore, pilots can connect the external receiver to it. F4 1S 5A FC (Serial ELRS 2.4G) is flexible in upgrading and has great potential. It supports being upgraded to ELRS V3.0 separately without flashing Betaflight flight controller firmware. The various colors of the spare parts including the 65 Pro 65mm frame, micro canopy, and propellers offer pilots more choices. Using them with BETAFPV waterslide decals, pilots can easily DIY and build their unique whoop drones. Specification Item: Meteor65 Pro 1S Brushless Whoop (2022) Weight: 23.01g (without battery) FC&ESC: F4 1S 5A FC (Serial ELRS 2.4G)/F4 1S 5A FC (SPI Frsky) Frame: Meteor65 Pro 65mm 1S Brushless Frame Motors: 0802SE Brushless Motor Props: 35mm 3-blade props (1.0mm Shaft) Camera: C03 FPV Camera Tilt: 30° (default)/20° (optional)