 300mAh battery. The discharge current is 9A in this test. The BT2.0 has double the time (about 2 minutes) and a 0.2v improvement in voltage sag. Flight Controller & ESC The latest F4 1S 5A flight controllers are applied to all BNF versions of Meteor65 Pro. It features Serial ELRS 2.4G instead of SPI ELRS 2.4G for ELRS version compared to the previous version. The Frsky version reserves two UART ports for the available external receiver so it can be used as PNP and can be switched to Futaba SFHSS protocol through Betaflight configurator. The ESC on the new board powered by BB51 hardware in place of BB21 comes with Bluejay 96k ESC firmware, allowing 0802SE 19500KV motors to give full play to the efficiency of power. We update the gyro to BOSH BMI270 for better performance and stability since the new F4 1S 5A FC. Meteor65 Pro (ELRS) Meteor65 Pro (Frsky, PNP, TBS) FC Inside F4 1S 5A FC (Serial ELRS 2.4G) F4 1S 5A FC (SPI Frsky) Gyro BMI270 BMI270 FC Firmware BETAFPVF411 BETAFPVF411RX UART Port One UART Port Two UART Ports External RX Not Supported Supported Note: For F4 1S 5A FC (serial ELRS 2.4G), ONLY Betaflight firmware 4.3.0 and up start to support BMI270 gyro. For F4 1S 5A FC (SPI Frsky), we recommend using BETAFPVF411RX 4.2.11 firmware and CLI dump file offered by BETAFPV. If you update the 4.3.0 and up firmware for serial ELRS 2.4G from the Betaflight official site, please flash the CLI dump file for Meteor65 Pro. Download the FC firmware and CLI dump file for Meteor 65 Pro ELRS2.4G, Frsky, or TBS. C03 Camera C03 FPV Micro Camera is 1.45g ultralight weight and a great camera for indoor micro FPV quadcopters. It features a 1200TVL definition with 1/3" CMOS sensor, 2.1mm lens for 160° FOV, and excellent latency, which boasts high-quality, clear and sharper images through your goggles. Motors 0802SE 19500KV Motor motor is a lightweight 1S motor, compared with the 0802 series brushless motors, it is not only significantly reduced the weight which is only 1.88g/pc bu