erformance in the dark. Balance layout for the whole quadcopter. When carrying an action camera like SMO 4K, or DJI Action 2, you can move the battery position and add the second battery strap to keep the center of gravity, preventing it from tilting to one side. The HD digital VTX version boasts a colorful and excellent image with 720P/120FPS high frame rate video in Nebula Pro Nano camera, bringing the feast for the eyes. The Analog VTX version comes with a Caddx Baby Ratel2 camera that has a 1/18" inch starlight HDR sensor with 1200TVL resolution, and A03 400mW VTX which is an open-source video transmitter with PIT/RCE/100mW/400mW adjustable output power. Walksnail HD VTX version equips with Walksnail Avatar HD Kit. Provides 1080P recording with 22ms ultra-low latency. Dual-antenna design for up to 4 km long-range transmission. Build-in 8 GB storage, it is convenient for recording video and can be exported by USB cable. Supports Betaflight full OSD display through Canvas Mode on Avatar VTX. Specification Weight: 153.3g (Caddx HD), 146g (Walksnail HD), 140g (Analog), Without battery and action camera Wheelbase: 108mm Frame: Pavo25 Frame Kit Motor: 1404 4500KV Brushless motor Battery Connector: XT30 Props: Gemfan D63-3B (Gray) Flight Controller: F405 AIO 20A Toothpick V4 BMI270 VTX: Caddx Nebula Pro Nano Vista Kit (HD Digital)/Caddx Baby Ratel2+A03 400mW 5.8G (Analog), Walksnail Avatar HD Digital Kit (HD Digital) Camera Adjustable Angle: 0°-50° Receiver Version: PNP/ELRS 2.4G/TBS (Optional) Recommend Battery: 4S 750mAh/4S 850mAh (Not included) Recommend Mounted Cam: SMO 4K, DJI Action 2 Flight Time (Reference Only): 7.5 mins (HD)/8.5 mins (Analog), using 4S 750mAh battery without an action camera Note: The actual flight time depends on the flight environment and the flight mode. Comparison to Beta95X V3 Let's see what has changed in the updates for Pavo25 Whoop Quadcopter. Compared with the Beta95X V3, Pavo25 is made of PA12 material with injected molding, which im