ides, it is smaller and designed for whoop drones. Walksnail HD Digital VTX Pavo25 Whoop Quadcopter Walksnail HD Digital VTX version features Avatar HD Kit with Avatar HD system that uses H.265 high-efficiency video coding, an industry-leading technology, providing 1080P/720P resolution image recording with 22ms ultra-low latency. The signals are stronger and more stable with a dual-antenna design for up to 4 km long-range transmission. Build-in 8 GB storage, the Avatar VTX has the capability of recording HD video without interference from capacity and exporting video by USB cable. Besides, with Canvas Mode on Avatar VTX, Betaflight full OSD display is supported and can be adjusted easily by remote control. Pavo25 Frame Kit Pavo25 frame is made of high-quality PA12 material with strong and durable injected molding, which grants more stable flight and no fear of damage. The whole frame with pusher and duct design can generate more lift for the whole quadcopter, improving the ability of endurance and propulsion. Besides, the vibration damping structure for the camera mount is optimized to carry an action camera easily, allowing pilots to have an excellent experience. What's more, it comes with a CNC Vista Adapter, which effectively provides the Caddx Vista HD Digital VTX with a good cool down by increasing the heat dissipation area, reducing the influence of heat on VTX. Note: If you need to buy CNC Vista Adapter separately, please click here. This CNC Vista Adapter is not suitable for Walksnail Avatar VTX. The Walksnail HD VTX version includes a CNC adapter designed for Walksnail Avatar VTX. FC & ESC Pavo25 whoop quadcopter is equipped with the Toothpick F405 AIO 20A FC V4 BMI270, it extremely reduces the weight while improving the ability of the ESC to continuous current 20A, and brings pilots more power to fly the Pavo25 quad! Meanwhile, 20A FC V4 has 2 pin connector ports for DJI Digital VTX and RX, just plug & play, less solder work needed, and super easy to inst