io incluso per una minore tensione Design ergonomico della calotta con bordi in gomma aderente 4 interruttori a 3 posizioni 2 potenziometri con tacca centrale 1x interruttori a 2 posizioni 1x pulsante momentaneo 4x pulsanti di assetto digitali Supporto per cordino perfettamente bilanciato Fino a 12 canali supportati Parallela 18650 x 2 (non inclusa!) con ricarica USB-C 2A (2,5 ore per la ricarica completa) Uscita audio vocale con jack audio e avviso di vibrazione tattile Sistema operativo di controllo remoto Open Source (FreedomTX, fork temporaneo di OpenTX) Selettore a bilanciere e menu a 3 pulsanti per una navigazione semplicissima Schermo LCD in bianco e nero ad alta risoluzione (128*64) con retroilluminazione Oltre 100 modelli di memoria con scheda SD inclusa Compatibile con TBS Cloud Specifiche del prodotto Peso: 565 g Batteria: 2×18650 Audio: altoparlante da 1 W e jack per cuffie da 3,5 mm Display: pannello LCD da 3,5′′ (128 x 64) Antenna: antenna incorporata Interruttori: 4 x 3 posizioni | 1 x 2 posizioni | 1 x momentaneo Porta USB-C: ricarica della batteria (5 V, 1 A), aggiornamenti del firmware e simulatore/HID Il Pacchetto Include: 1 telecomando TBS Mambo 1 x set di molle (bassa tensione) 2 viti di limitazione dell’acceleratore (con chiave a brugola) Maggiori informazioni Manuale TBS Mambo Codice sorgente FreedomTX Download dei contenuti della scheda SD Mambo (per Freedom TX 1.2x) TBS Cloud – Firmware Wi-Fi Agente TBS Lite	189.98	EUR	https://www.drone24hours.com/wp-content/uploads/2022/02/TBS-MAMBO-1.jpeg	https://www.drone24hours.com/prodotto/tbs-mambo-controller-per-drone-radio-fpv-rc/?D24H=lucapalonca	7	f	2023-06-08 06:38:56.899549	\N	10	bd9bc1c3-88c3-41ac-8fd8-b5273c88d247	60
