2023-06-08 06:38:58.596219	t	Drone24Hours_TBS_UNIFY_PRO_5G8_HV_(SMA)	TBS UNIFY PRO 5G8 HV (SMA)	Il trasmettitore video più popolare e potente sul mercato ha appena ottenuto un fratello “più grande”. Può essere collegato direttamente a un massimo di 6 S di batteria scarica e può produrre 5 V in uscita per la fotocamera. Filtrerà la potenza e si assicurerà di ottenere video puliti, anche senza essere collegati a un TBS CORE o TBS PowerCube. Con un nuovissimo monitor di potenza attiva in uscita, ti garantiamo di soddisfare sempre i requisiti della gara, offrendoti al contempo la migliore immagine possibile. Con solo 7g e un fattore di forma 31x22x6mm, il tuo quad a malapena noterà che è lì. La potenza di uscita regolabile da 25mW a 800mW ti consente di gareggiare con gli amici e di penetrare in cemento con la semplice pressione di un pulsante. La copertura 40CH ti dà la libertà di volare in qualsiasi gara senza dover ricorrere alle pratiche di scambio del trasmettitore video (*). Pitmode-fatto per correre Zero interferenze anche durante l’accensione, ora è una possibilità! Se hai mai riparato un quad durante una gara, conoscerai le frustrazioni di non poter accendere e testare il tuo sistema. Con PitMode, ridurremo la potenza di uscita al minimo indispensabile (molto al di sotto dei mW a una cifra) e ci sposteremo alle frequenze non utilizzate dagli organizzatori di gare, per consentirti di accendere il tuo quad e vedere ancora l’immagine! Hai qualche metro di autonomia per mettere alla prova il tuo quad prima di posizionarlo su quella griglia di partenza e in combinazione con CleanSwitch puoi accenderlo non appena il tuo canale è disponibile senza interrompere nessuno dei canali attivi. Smartaudio-controllo completo La tecnologia SmartAudio fornisce il controllo UART e I2C per l’intero trasmettitore video. Parametri come potenza di uscita, bande, canali e frequenza possono essere controllati liberamente. Ciò consente il controllo remoto dei canali direttamente da un dispositivo intelligente (TBS Crossfire, è richiesto un modulo bluetooth esterno o wifi), dalla radio (TBS Crossfire con TBS Tango o telecomando compatibile OpenTX richiesto) o dall’OSD (ad es. TBS CORE PRO). Con tutte queste opzioni disponibili, dovresti trovare qualcosa che si adatta al tuo conto. Insieme a CleanSwitch, il cielo è il limite ... saltare tra i canali senza interferire con gli altri piloti in aria, creare frequenze di backup / emergenza, regolazioni globali della potenza VTx da parte degli organizzatori di gare o altri sistemi intelligenti volti a semplificare e migliorare la gestione della gara sono ora una possibilità! Cleanswitch-neighbor friendly CleanSwitch è una tecnologia sviluppata da TBS che garantirà che il trasmettitore video sia privo di interferenze durante l’accensione o durante la modifica dei canali. Tutti gli attuali trasmettitori video passano sull’intera banda mentre sono accesi, causando spesso sfarfallio e forti interferenze con chiunque nell’aria, indipendentemente dal canale video scelto. TBS CleanSwitch ti permetterà di accendere e cambiare canale mentre i tuoi amici sono in aria, senza alcuna interferenza esterna. CleanSwitch è adatto alle gare e ai piloti ... ecco come ci piace a TBS 🙂 Di no! a dipswitches Anche se l’apprendimento binario è stato un divertente gioco mentale, in pratica un trasmettitore video a pulsante singolo o controllato da OSD è molto più semplice da utilizzare. Sono finiti i tempi delle schede del trasmettitore video, che calpestavano i canali delle persone per errore o una discrepanza tra la frequenza della maschera e quella del trasmettitore video. Specifiche Tensione di funzionamento: 2S – 6S Corrente di alimentazione: fino a 600mA Temperatura operativa: controllare il normale flusso d’aria Frequenza portante audio: 6,5 MHz Impedenza di ingresso video: 75 Ohm Peso: 7 g (con SMA, senza antenna) Connettore di ingresso: JST GH 7pin (dopo luglio 2018) Connettore antenna: presa femmina SMA con fori per il montaggio a vite Formato video: NTSC / PAL Potenza di uscita: 13dBm (25mW), 23dBm (200mW), 27dBm (500mW), 29dBm (800mW *) Il pacchetto include Trasmettitore video HV TBS UNIFY PRO 5G8 Trasmettitore video / videocamera / cavo di alimentazione DOWNLOAD Manuale TBS UNIFY Pro Manuale TBS UNIFY Pro (tedesco) Specifiche di TBS SmartAudio * Per il funzionamento su canali HAM e livelli di potenza HAM è necessaria la licenza HAM! Il VTx viene fornito con solo canali legali abilitati, consultare il manuale sulla procedura di sblocco.	60.99	EUR	https://www.drone24hours.com/wp-content/uploads/2019/12/A7300562.jpeg	https://www.drone24hours.com/prodotto/tbs-unify-pro-5g8-hv-sma/?D24H=lucapalonca	7	t	2023-06-08 06:38:58.596196	\N	10	01a4ddb0-f668-44ab-a1d3-3440220ec311	60
