py for HD Camera is specially designed to be compatible with Walksnail or HDZero HD digital VTX and has an adjustable camera lens of 0-45°. With the injection molding technique, the canopy is very durable and flexible for crash resistant. Besides, the hollow-out design not only reduces the influence of heat on electronic parts but also is available to be armed with decorative parts we prepared. New 1102 18000KV Motors 1102 18000KV motors have a great balance between weight and power on 75mm 1S whoop drones. Only 2.9g with connectors. With the high 18000KV, it could have a great punch power even with only 1S battery. Also, it adopts a PCB connector to allow you to repair it easier once cables are disconnected. Flight Controller The latest F4 1S 5A flight controllers are applied to all BNF versions of Meteor75 HD. It features Serial ELRS 2.4G instead of SPI ELRS 2.4G for ELRS version compared to the previous version. The Frsky version reserves two UART ports for the available external receiver so it can be used as PNP. The ESC on the new board is powered by BB51 hardware in place of BB21. Last but not least, we update the gyro to BOSH BMI270 for better performance and stability since the new F4 1S 5A FC. Meteor75 HD (ELRS) Meteor75 HD (Frsky, PNP, TBS) FC Inside F4 1S 5A FC (Serial ELRS 2.4G) V2.0 F4 1S 5A FC (SPI Frsky) V3.0 Gyro BMI270 BMI270 FC Firmware BETAFPVF411 BETAFPVF411RX UART Port One UART Port Two UART Ports External RX Not Supported Supported Note: Pay attention, ONLY the newest Betaflight firmware 4.3.1 start to support this BMI270 gyrometer. Please check the below link to download the firmware and CLI dump file. If you update the 4.3.1 firmware from Betaflight official site, please flash the CLI dump file for Meteor75 HD. Download the FC firmware and CLI dump file for Walksnail and HDZero version. Recommended Parts Radio Transmitter: LiteRadio 3 Pro, LiteRadio 3, LiteRadio 2 SE Battery: BT2.0 450mAh 1S 30C Battery, BT2.0 550mAh 1S Battery Props: 40mm 3-