2023-06-08 06:38:55.364544	t	Drone24Hours_TBS_TRACER_MICRO_TX_STARTER_SET	TBS TRACER MICRO TX STARTER SET	Presentazione di TBS TRACER – sistema radio “CROSSFIRE” A 2,4 GHZ 250Hz: collegamento radio e telemetria più veloce disponibile Nuova tecnologia a 2,4 GHz non presente in nessun altro collegamento radio 3ms end to end latenza Motore Crossfire per la massima compatibilità e funzionalità Trasmettitori con fattore di forma “JR” e “LITE” Ricevitore di dimensioni nanometriche con diversità di antenna 15mi + / 25 km + portata Per droni, aerei, elicotteri, auto e barche Il collegamento rapido più veloce In una gara contano i microsecondi. Occhiali abbassati, pollice in alto: siete pronti per un collegamento radio bidirezionale a 250Hz? Latenza end-to-end: praticamente zero (ok, 3 ms!). Intervallo: per giorni. Niente si avvicina! Abbiamo preso il meglio da Crossfire e l’abbiamo ridotto e accelerato. Non solo per piloti race e “freerange” Una singola modalità operativa soddisfa tutti i requisiti. Una frequenza di aggiornamento di 250 Hz da brivido. Molta penetrazione e portata per superare anche il collegamento video più serio. La piena capacità di telemetria è standard, senza alcuna degradazione della portata! Grazie al pedigree Crossfire, i piloti di droni, i piloti R / C tradizionali e tutti gli altri possono attingere immediatamente alla famiglia di software, dispositivi, telecomandi e schede di montaggio compatibili. Facilità di utilizzo: Aggiornamenti del firmware OTA, auto-bind, multi-bind, configurazione del dispositivo LUA come PID del controller di volo, ecc. E connettività cloud: nessun problema! Queste sono tutte caratteristiche che TBS ha introdotto per la prima volta nello spazio R / C con TBS Crossfire! Tutti i ricevitori arrivano in modalità binding e ricorda il tuo binding su tutte le tue radio, quindi il pulsante di binding tecnicamente non è mai necessario. Sotto il cappuccio: TBS Tracer funziona con il motore Crossfire. Oltre 6 anni di sviluppo attivo e di gran lunga il sistema R / C più popolare per gli appassionati di FPV! Attingi immediatamente alla stessa affidabilità, funzionalità e compatibilità che i piloti di droni vedono come sinonimo di tranquillità. Allora qual è la differenza? Velocità di aggiornamento più elevata, latenza inferiore, antenne più piccole grazie alla frequenza più elevata. Gli utenti di Crossfire si sentiranno come a casa! La garanzia TBS: Negli oltre 10 anni della nostra esistenza, gli aggiornamenti software sono sempre stati gratuiti, continui e abbondanti. L’hardware è costruito per la longevità e viene fornito con una vasta gamma di funzionalità che devono ancora essere sbloccate. Il supporto è sempre stato incentrato sulla soddisfazione del cliente. Per i piloti, dai piloti. Questo è il motivo per cui i prodotti TBS hanno il seguito più ampio e perché l’investimento in TBS Tracer continuerà a dare i suoi frutti in futuro, proprio come TBS Crossfire continua a fare per tutti gli hobbisti. Come ringraziamento da parte nostra per il vostro supporto, visitate il nostro sito Web e inserite il numero di serie del vostro Crossfire come codice coupon per uno sconto del 25% su tutti i prodotti TBS Tracer TX e RX! Caratteristiche: Sistema di controllo remoto a lungo raggio, adattivo e robusto per il tuo drone e aereo Bassa latenza, frequenza di aggiornamento di 250 Hz (5 volte più veloce del normale, la più veloce al mondo) per una precisione strabiliante Collegamento di comunicazione bidirezionale con dati vitali di collegamento in tempo reale e telemetria Aggiornamenti firwmare OTA, auto-bind, supporto multi-bind Connettività TBS Cloud con output di telemetria per app per smartphone Completamente configurabile da OpenTX e TBS TANGO remoto utilizzando il protocollo CRSF Un numero “illimitato” di persone può volare contemporaneamente Potenza in uscita: 25 mW / 100 mW Uscita a 8 o 12 canali tramite CRSF, SBUS, SBUS invertito o PPM Modem seriale in grado di 