g system (FreedomTX, temporary fork of OpenTX) Rocker dial and 3 button menu for super simple navigation High resolution (128*96) black & white OLED screen w/ backlight Digital rocker dial trim 100+ model memory with included SD-card TBS Cloud compatible TBS TANGO 2 INCLUDES 1 x Tango 2 Pro 1 x Velvet Carry Bag with TBS Logo 1 x Springs Set ( Default and Lower Tension) 2 x Throttle limitation screws (with allen key) 1 x Sticker Sheet 1 x Tango 2 3D KeyChain (will only be included in the first run) MORE INFORMATION Self-support (FAQ) Lanyard mount 3D print download TBS Tango 2 Manual *Power and distance are subject to specific regulations, be sure to respect those established in the country where you are playing.  Voir plus	194.90	EUR	https://www.drone-fpv-racer.com/24084-large_default/tbs-tango-2.jpg	https://www.drone-fpv-racer.com/en/tbs-tango-2-5930.html?aff=75	9	f	2023-06-08 06:39:11.899285	\N	10	d26ed139-c471-4b30-9ed9-10d96c652de2	53
