ound). In case of a crash, the location of the drone is visible on the OLED as well. The built in battery on the receiver turns it into a beacon automatically - and it will continue to transmit its last known location until the battery runs out.  IT JUST WORKS Apart from unparalelled range, the thing that we are most proud about on the TBS CROSSFIRE is that it just works. In the past, our question always was "could our R/C link keep up?". With the TBS CROSSFIRE comes peace of mind. But don't take our word for it. All leading drone racing organizers require pilots to fly the TBS Crossfire. All top drone racers fly the TBS Crossfire. The furthest long range missions are flown with TBS Crossfire. This is the long range link that everyone has been waiting for! TELEMETRY / CRSF As a modern R/C link, it has telemetry built in. Two-way communication opens up new possibilities. From streaming MAVLink to you smart device, to updating your firmware, setting your video transmitter channel or adjusting flight control parameters such as PIDs. Adaptive bandwidth controls the speed of transmission or optimizes for ultimate range. CRSF is a proprietary TBS communication protocol between the Crossfire and R/C and Flight Control. It provides ultra-low latency with incredible bandwidth (3x faster, 6x more data than any comparable protocol!). With such tight integration, the TBS Crossfire is the logical choice for anyone flying Betaflight, KiSS or ArduPilot/Pixhawk platforms.  Download the manual Download TBS Agent (software updates) FEATURES: Long range, adaptive and robust remote control system for your aircraft Immune to on-board noise Two-way communication link with real-time link vitals and telemetry Self-healing & frequency hopping (DSSS, FHSS) Adaptive bandwidth control and range optimization Serial Modem capable of transmitting MAVLink or other serial protocols (up & downlink) RX beacon mode to recover your downed aircraft Super easy binding and configuration via built-in display Low latency, 150Hz update rate (3x faster than typical RC links) control for perfect immersive feeling Two receiver models: 8ch Diversity Rx, 4ch PPM/SBUS Mini-receiver (4g weight!) 8 or 12ch output via PPM/SBUS/CRSF on both receivers Ability to fly with multiple friends at the same time (10 or more) Selectable RF power from 10mW to 2W (local restrictions apply) Dedicated head-tracking input option for full FPV immersion Transmitter LED shows link health, OLED display for built in configuration Short-Range mobile connectivity telemetry output for smartphone apps Fully configurable by OpenTX and TBS TANGO remote using CRSF protocol  CRSF protocol interface to Betaflight, Kiss and Raceflight FCs ( lower latency, higher update rate, telemetry support )  Expansion port for future feature support Micro-receiver for smaller drones. Smaller than you think! Software updates via RF Link TECHNICAL SPECIFICATIONS: Frequency Bands: 868MHz (EU, Russia) / 915MHz (USA, Asia, Australia) Input Voltage: 3.5 - 13V Power consumption: 1.1W (@10mW) - 3.2W (@2000mW) Dimensions: 55 x 89 x 15 mm Weight: 76g PACKAGE INCLUDES TBS Crossfire Transmitter TBS Crossfire JR Adapter TBS Crossfire Stock Tx Antenna Crossfire Futaba cable Crossfire Graupner cable Crossfire PWM Pigtail Crossfire JST to XT30 cable CERTIFICATES TBS Crossfire - FCC Certificate Part 15C TBS Crossfire - FCC Certificate Part 15B TBS Crossfire - FCC DOC TBS Crossfire - RED Declaration of Confirmity	149.95	USD	https://cdn.shopify.com/s/files/1/2778/6650/products/liteDSC07088zz2-tn_efbe165d-cd59-4434-b7cf-8227b889d260_740x.jpg?v=1597163909	https://pyrodrone.com/products/tbs-crossfire-tx-lite	18	t	2023-06-09 07:32:45.336399	\N	10	31177940-34c2-4614-adad-a6d96ffafb16	92
