2023-06-09 07:32:55.705779	t	Pyro_Drone_TBS_Unify_Pro32_Nano_5G8_V1.1_VTx_Video_Transmitter	TBS Unify Pro32 Nano 5G8 V1.1 VTx Video Transmitter	With the TBS UNIFY PRO32 Nano we have boosted the output power, improved the robustness, decreased the power consumption, added capability for insane features and perfected the way it is installed in your multirotor. In a nutshell, it’s the most comprehensive, future proof, highest quality and overall best nano VTx ever made. MAIN FEATURES Smallest, lightest video transmitter on the market Up to 500mW of output power Ultra-clean transmission (up to 16 pilots at once!) PitMode - power up your quad during a race. Now with team-race capability! Easy OSD, FC and RC channel changes, with fallback button menu Robust RF amplifier allows powering up without antenna for hours! Clean powerup and video switching CE certified PITMODE - MADE TO RACE Zero interference even while powered up, it's now a possibility! If you've ever repaired a quad during a race, you'll know the frustrations of not being able to power on and test your system. With PitMode, we will reduce the output power to a bare minimum (way below single digit mW's) to allow you to power up your quad and still see the image! You've got less than one meter of range to put your quad through its paces before placing it on that starting grid. Using SmartAudio or CRSF, you can power up the VTx using your remote! SMARTAUDIO V2.1 & CRSF - TEAM RACE READY SmartAudio technology provides UART control for your entire video transmitter. Parameters such as output power, bands, channels and frequency can be freely controlled. This enables remote channel control directly from a smart device (TBS Crossfire, external bluetooth or wifi module required), from your radio (TBS Crossfire with TBS Tango or OpenTX compatible remote required), or from the OSD (e.g. Betaflight OSD, TBS CORE PRO). With all these options available, you ought to find something that fits your bill. Together with CleanSwitch, the sky is the limit ... jump between channels without interfering fellow pilots in air, create backup-/emergency-frequencies, global VTx power adjustments by race organizers or other clever systems aimed at streamlining and improving race management are now a possibility! CLEANSWITCH - NEIGHBOR FRIENDLY CleanSwitch is a technology developed at TBS that will ensure that your video transmitter is interference-free while powering on, or while changing channels. All current video transmitters swipe across the entire band while being powered on, often resulting in flickering and heavy interference to anyone in the air, regardless of video channel chosen. TBS CleanSwitch will allow you to power on and change channels while your buddies are in the air, without any external interference. CleanSwitch is race friendly, and pilot friendly ... that's how we like it at TBS :) SPECIFICATIONS Operating Voltage: 3-13V Operating Temperature: watch for normal airflow Video Input Impedance: 75 Ohm Weight: 1g Dimensions: 15 x 13 x 2mm Antenna Connector: u.FL socket Video Format: NTSC/PAL Output Power: 14dBm (25mW), 20dBm (100mW), 26dBm (400mW) INCLUDED 1x TBS UNIFY PRO32 5G8 Video transmitter 1x Silicone cable set (pre-tinned) 1x Linear whip antenna 1x Shrink Tube DOWNLOADS TBS UNIFY Pro32 Manual TBS UNIFY Pro32 Manual (German) Declaration of Conformity	29.95	USD	https://cdn.shopify.com/s/files/1/2778/6650/products/DSC01594-ga_524659c8-78f1-4a17-b5f9-1ca94e314b4d_740x.jpg?v=1594657314	https://pyrodrone.com/products/tbs-unify-pro32-nano-5g8	18	t	2023-06-09 07:32:55.705754	\N	10	06edac51-221d-4de5-81b8-c2f15cc229ad	92
